const getMembersReducer = (state = [], action) => {
  switch (action.type) {
    case "SET_ALL_USERS":
      return action.payload;
    default:
      return state;
  }
};

const getMember = (state = {}, action) => {
  switch (action.type) {
    case "SET_ALL_USERS":
      return action.payload;
    default:
      return state;
  }
};

// user will be on the redux state at:
// state.user
export default getMembersReducer;
